import React from 'react';

const Test = () => {
  return (
    <div style={{ padding: '20px', backgroundColor: 'lightgreen' }}>
      <h1>Page de test fonctionnelle</h1>
      <p>Si vous voyez ceci, la route fonctionne.</p>
    </div>
  );
};

export default Test; // Exportez bien "Test" (nom du composant)
